// Import dependencies
import React from "react";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import "./App.css";
import Homepage from "./components/Homepage/Homepage";

function App() {
  return(
    <div className = "app">
      <BrowserRouter>
        <Routes>
          <Route exact path = "/" Component={Homepage}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
